const projectsData = [
  {
    name: 'Wyag ',
    type: 'Open-source project',
    tech: 'python',
    image: gitImage,
    description: 'DIY git',
    live: '',
    github: 'https://github.com/filippoferrando/wyag',
  },

  {
    name: 'Brainfuck',
    type: 'Test project',
    tech: 'brainfuck, javascript',
    image: brainfuck,
    description: 'Brainfuck interpreter builded with js',
    live: '',
    github: 'https://github.com/filippoferrando/Brainfuck',
  },
  {
    name: 'Jenkins',
    type: 'Test project',
    tech: 'AIML',
    image: chatBot,
    description: 'Test chatbot build with AIML',
    live: '',
    github: 'https://github.com/filippoferrando/jenkinsBot',
  },
  {
    name: 'Blockchain-based Chat',
    type: 'Python project',
    tech: 'python, bitcoin, blockchain',
    image: Blockchain,
    description: 'Blockchain-based chatroom with distributed node',
    live: '',
    github: 'https://github.com/filippoferrando/blockchain.git',
  },
];

export default projectsData;
